import React from "react";  

const Card = (props)=>{
    <>
        <div className="cards">
            <div className="card">
                <img src={props.imgsrc} alt="" />
                <div className="card_info">
                    {/* <h2> {props.name} </h2> */}
                </div>
            </div>
        </div>
    </>
}


export default Card;
